чите это сообщение электронной почты, отправленное пользователю с уведомлением о том, что регистрация одобрена администратором сайта.','Enable this email sent to the user notifying the registration is denied by the admin.'=>'Включите это сообщение электронной почты, отправленное пользователю с уведомлением о том, что регистрация запрещена администратором.','Enable this email sent to the user notifying the registration is pending.'=>'Включите это сообщение электронной почты, отправленное пользователю с уведомлением о том, что регистрация еще не завершена.','Error on google reCaptcha. Contact your site administrator.'=>'Ошибка на Google reCaptcha. Обратитесь к администратору сайта.','Form'=>'Форма','Form not found, form id :'=>'Форма не найдена, идентификатор формы :','Select &#38; display one of your form.'=>'Выберите &#38; отобразить одну из ваших форм.','Select a Form'=>'Выберите форму','user registration adminfield is required.'=>'является обязательным полем.','user-registration adminUser Email'=>'Электронная почта пользователя','user-registration adminUser Password'=>'Пароль пользователя','In this subsection you should list which third party modules you’re using to increase functionality on your site since these may handle customer data. We’ve included MailChimp as an example, but you should remove this if you’re not using MailChimp.'=>'В этом подразделе Вы должны указать, какие сторонние модули вы используете для повышения функциональности вашего сайта, так как они могут обрабатывать данные клиентов. Мы включили MailChimp в качестве примера, но вы должны удалить его, если вы не используете MailChimp.','Minimum Password Strength'=>'Минимальная сложность пароля','Please see the <a href="https://mailchimp.com/legal/privacy/">MailChimp Privacy Policy</a> for more details.'=>'Пожалуйста, смотрите <a href="https://mailchimp.com/legal/privacy/"> Политика конфиденциальности MailChimp</a> для получения более подробной информации.','We send beautiful email through MailChimp. When processing emails, some of your data will be passed to MailChimp, including information required to process or support the email marketing services, such as the name, email address and any other information that you intend to pass or collect including all collected information through subscription.'=>'Мы отправляем красивую электронную почту через MailChimp. При обработке электронных писем некоторые из ваших данных будут переданы MailChimp, включая информацию, необходимую для обработки или поддержки служб маркетинга электронной почты, такую как имя, адрес электронной почты и любую другую информацию, которую вы намерены передать или собрать, включая всю собранную информацию по подписке.','Available Modules'=>'Доступные модули','In this subsection you should list which third party payment processors you’re using to take payments on your site since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'В этом подразделе Вы должны указать, какие сторонние платежные системы вы используете для приема платежей на вашем сайте, поскольку они могут обрабатывать данные клиентов. Мы включили PayPal в качестве примера, но вы должны удалить это, если вы не используете PayPal.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Дополнительную информацию см. в <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">Политике конфиденциальности PayPal</a>.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Мы принимаем платежи через PayPal. При обработке платежей часть ваших данных будет передана в PayPal, включая информацию, необходимую для обработки или поддержки платежа, такую как общая сумма покупки и платежная информация.','Customer information like your name, email and address information.'=>'Информация о клиенте, как ваше имя, адрес электронной почты и адресную информацию.','Form submission information and other details related to it'=>'Форма подачи информации и другие детали, связанные с ней','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'В этом разделе необходимо перечислить третьи стороны, которым вы передаёте информацию, и указать, с какой целью вы это делаете. К таким целям может относиться, например, анализ данных, маркетинг, обеспечение работы платёжных шлюзов и встроенных объектов сторонних разработчиков.','Members of our team have access to the information you provide us. For example, both Administrators and Editors can access:'=>'Члены нашей команды имеют доступ к информации, которую вы предоставляете нам. Например, как администраторы, так и редакторы могут получить доступ:','Our team members have access to this information to help fulfill entries and support you.'=>'Члены нашей команды имеют доступ к этой информации, чтобы помочь выполнить записи и поддержать вас.','Payments'=>'Платежи','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store form submission information for XXX years for geolocating and marketting purposes. This includes your name, address, email, phone number.'=>'Как правило, мы храним информацию о вас до тех пор, пока она нам необходима для целей, для которых мы ее собираем и используем, и мы не обязаны по закону продолжать ее хранить. Например, мы будем хранить информацию о подаче формы в течение XXX лет для целей геолокации и маркетинга. Это включает в себя ваше имя, адрес, адрес электронной почты, номер телефона.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Мы делимся информацией с третьими лицами, которые помогают нам предоставлять вам наши заказы и услуги магазина; например --','What we share with others'=>'Какую информацию мы передаём третьим сторонам','Who on our team has access'=>'У каких членов нашей команды есть доступ','Comply with any legal obligations we have, such as calculating taxes'=>'Соблюдайте все наши юридические обязательства, такие как расчет налогов','If you create an account, we will store your name, address, email and phone number, which will be used to populate the form fields for future submissions.'=>'Если вы создадите учетную запись, мы сохраним Ваше имя, адрес, адрес электронной почты и номер телефона, которые будут использоваться для заполнения полей формы для будущих взаимодействий с сайтом.','Improve our form offerings'=>'Улучшите наши предложения формы','Or any other service the built form was created to comply with and it’s necessary information'=>'Или любой другой сервис построенная форма была создана для соблюдения и это необходимая информация','Process payments and prevent fraud'=>'Обработка платежей и предотвращение мошенничества','Respond to your requests, including transaction details and complaints'=>'Отвечайте на ваши запросы, включая детали транзакций и жалобы','Send you information about your account and order'=>'Отправить вам информацию о вашем счете и заказе','Send you marketing messages, if you choose to receive them'=>'Отправлять вам маркетинговые сообщения, если вы решите их получать','Set up your account for our site'=>'Настройка учетной записи для нашего сайта','When you fill up a form, we’ll ask you to provide information including your name, address, email, phone number, payment details and optional account information like username and password and any other form fields available in the registration form. We’ll use this information for purposes, such as, to:'=>'Когда вы заполняете форму, мы просим Вас предоставить информацию, включая ваше имя, адрес, адрес электронной почты, номер телефона, платежные реквизиты и дополнительную информацию об учетной записи, такую как имя пользователя и пароль, а также любые другие поля формы, доступные в регистрационной форме. Мы будем использовать эту информацию для таких целей, как:','Form Fields Data: Forms Fields data includes the available field types when creating a form. We’ll use this to, for example, collect informations like Name, Email and other available fields.'=>'Данные полей форм: данные полей форм включают доступные типы полей при создании формы. Мы будем использовать это, например, для сбора информации, такой как имя, адрес электронной почты и другие доступные поля.','Location, IP address and browser type: we’ll use this for purposes like geolocating users and reducing fraudulent activities.'=>'Местоположение, IP-адрес и тип браузера: мы будем использовать это для таких целей, как геолокация пользователей и сокращение мошеннических действий.','This sample policy includes the basics around what personal data you may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your form will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Этот пример политики содержит основные сведения о том, какие личные данные вы можете собирать, хранить и передавать, а также Кто может иметь доступ к этим данным. В зависимости от того, какие настройки включены и какие дополнительные плагины используются, конкретная информация, предоставляемая вашей формой, будет отличаться. Мы рекомендуем проконсультироваться с юристом при принятии решения о том, какую информацию раскрывать в вашей политике конфиденциальности.','Transaction Details: we’ll ask you to enter this so we can, for instance, provide subscription packs, and keep track of your payment details for subscription packs!'=>'Детали транзакции: мы попросим вас ввести это, чтобы мы могли, например, предоставлять пакеты подписки и отслеживать Ваши платежные реквизиты для пакетов подписки!','We collect information about the user during the user registration form submission process on our site.'=>'Мы собираем информацию о пользователе в процессе подачи формы регистрации пользователя на нашем сайте.','What we collect and store'=>'Какие данные мы собираем и храним','While you visit our site, we’ll track:'=>'Когда вы посещаете наш сайт, мы сохраняем следующие сведения о вас:','Export Users'=>'Экспорт пользователей','Export your users along with their extra information registered with a user registration form as a <strong>CSV</strong> file.'=>'Экспортируйте пользователей вместе с их дополнительной информацией, зарегистрированной в форме регистрации Пользователя, в виде файла <strong>CSV</strong>.','Hint: To make password stronger, use upper and lower case letters, numbers, and symbols like ! " ? $ % ^ & ).'=>'Подсказка: чтобы сделать пароль сильнее, используйте буквы верхнего и нижнего регистра, цифры и символы, такие как ! "? $ % ^ & ).','Medium'=>'Средний','No users found with this form id.'=>'Пользователи с этим идентификатором ID не найдены.','Please enter a stronger password.'=>'Пожалуйста, введите более надёжный пароль.','Strong'=>'Сильный','User ID'=>'Пользовательский ID','User Registered'=>'Зарегистрированный пользователь','User Registered GMT'=>'Пользователь, зарегистрированный по Гринвичу','User Role'=>'Роль пользователя','Very Weak'=>'Очень слабый','Weak'=>'Слабый','Check to enable/disable lost password.'=>'Установите флажок, чтобы включить / отключить "Восстановить пароль".','Choose the login form template.'=>'Выберите шаблон формы входа.','Form Template'=>'Шаблон формы','Login Options'=>'Настройки Формы входа','Copied!'=>'Скопировано!','Copy Shortcode!'=>'Копировать шорткод!','Current password'=>'Текущий пароль','Invalid